import ExpenseItem from './ExpenseItem'

function Expenses(props) {

  return (
    <div>
      <ExpenseItem
        title={props.expense[0].title}
        amount={props[0].amount}
        date={props[0].date}
      />
      <ExpenseItem
        title={props[1].title}
        amount={props[1].amount}
        date={props[1].date}
      />
      <ExpenseItem
        title={props[2].title}
        amount={props[2].amount}
        date={props[2].date}
      />
    </div>
  );
}

export default Expenses;
